    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( + 91, 60 * col0, - col2 * - col2 / - - ( - 42 ) + - col2 + - + col0 * - CAST ( NULL AS REAL ) * + col0 * - col1 + - + 86 * col2 );
  - name: tab2

outputs:
  - name: q12160.out
    data: |
